import { getYear } from "date-fns";
import { ObterListaDeFeriados } from "./calendarios/brazil/tiposDeCalendarios/ANBIMA";
import { obterDomingoDePascoa } from "../core/calendariosLunares/gregoriano";

export function VerificarSeDiaUtil(ano) {
  let ListaDeFeriados = ObterListaDeFeriados(ano);
  console.log(ListaDeFeriados);
  return ListaDeFeriados;
}

export function verify(ano) {
  const domingoDePascoa = obterDomingoDePascoa(ano);
  return domingoDePascoa;
}
